import React, { useEffect, useState } from 'react'
import { useParams, Link, useNavigate } from 'react-router-dom';
import { get_item, ChangeBirthday, ChangeDescription, get_birthday, get_description, set_id } from '../management/birthday_service';
export const BirthdayPage = () => {
    let { id } = useParams();
    useEffect(() => {
        get_item()
    }, [id])
    set

    return (
        <div>
            <textarea className='change_text_area' defaultValue={get_description() ?? ''} onChange={(event) => ChangeDescription(event)}></textarea>
            <input type="date" defaultValue={get_birthday()} onChange={(event) => ChangeBirthday(event)}></input>
        </div>
    )
}
